import React from 'react';




export class MoviesList extends React.Component {
//binds passed handler to StreamsList handler
  constructor(props){
    super(props)
  }

  componentDidMount() {
  }

  render() {
    console.log(this.props.search.length)
      if (this.props.search.length <= 2) {
        console.log('less')
        return(
          ""
        )
      }   
      else if (this.props.movie.slug.includes(this.props.search)){
        return (
          <div className="moiveCard">
            <h1> {this.props.movie.slug} </h1>
          </div>
        )
      }
      else{
        return(
          ""
        )
      }
  }

}

export default MoviesList;
